INSERT INTO `his_config_info` VALUES (187, 2441, 'erahub-job.yml', 'DEFAULT_GROUP', '', 'spring:\n  datasource:\n    dynamic:\n      # 设置默认的数据源或者数据源组,默认值即为 master\n      primary: master\n      datasource:\n        # 主库数据源\n        master:\n          driver-class-name: com.mysql.cj.jdbc.Driver\n          url: ${datasource.job.url}\n          username: ${datasource.job.username}\n          password: ${datasource.job.password}\n\nxxl:\n  job:\n    # 执行器开关\n    enabled: true\n    # 调度中心地址：如调度中心集群部署存在多个地址则用逗号分隔。\n    # admin-addresses: http://localhost:9900\n    # 调度中心应用名 通过服务名连接调度中心(启用admin-appname会导致admin-addresses不生效)\n    admin-appname: erahub-xxl-job-admin\n    # 执行器通讯TOKEN：非空时启用\n    access-token: xxl-job\n    # 执行器配置\n    executor:\n      # 执行器AppName：执行器心跳注册分组依据；为空则关闭自动注册\n      appname: ${spring.application.name}-executor\n      # 执行器端口号 执行器从19901开始往后写\n      port: 9901\n      # 执行器注册：默认IP:PORT\n      address:\n      # 执行器IP：默认自动获取IP\n      ip:\n      # 执行器运行日志文件存储磁盘路径\n      logpath: ./logs/${spring.application.name}/xxl-job\n      # 执行器日志文件保存天数：大于3生效\n      logretentiondays: 30\n', 'fc8018e383a55aa8a60c66fc6ca488c0', '2023-01-08 10:21:45', '2023-01-08 02:21:46', 'nacos', '223.65.103.1', 'U', 'prod', '');
INSERT INTO `his_config_info` VALUES (188, 2442, 'erahub-monitor.yml', 'DEFAULT_GROUP', '', '# 监控中心配置\nspring:\n  security:\n    user:\n      name: erahub\n      password: 123456\n  boot:\n    admin:\n      ui:\n        title: Erahub-Plus-Auth服务监控中心\n      discovery:\n        # seata 不具有健康检查的能力 防止报错排除掉\n        ignored-services: erahub-seata-server\n', '20aa23e33d141dcd976a1c8f591ea087', '2023-01-08 10:21:55', '2023-01-08 02:21:56', 'nacos', '223.65.103.1', 'U', 'prod', '');
